import classes from "*.module.css";
import React from "react";

const DemoList = (props) => {

    const sortedList = props.items.sort((a, b) => a-b);

return (
    <div className={classes.list}>
        <h2>{props.title}</h2>
        <ul>
            {sortedList.map((item)=>(<li>{item}</li>))}
        </ul>
    </div>
);
};

export default DemoList;
